CREATE TABLE `bimestre` (
  `Id_Bimestre` smallint(6) NOT NULL AUTO_INCREMENT,
  `Bimestre` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`Id_Bimestre`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

CREATE TABLE `secretaria` (
  `Id_Secretaria` smallint(6) NOT NULL AUTO_INCREMENT,
  `Login` varchar(20) DEFAULT NULL,
  `Senha` varchar(12) DEFAULT NULL,
  PRIMARY KEY (`Id_Secretaria`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

CREATE TABLE `usuario` (
  `Id_Usuario` smallint(6) NOT NULL AUTO_INCREMENT,
  `Login` varchar(20) NOT NULL,
  `Senha` varchar(12) NOT NULL,
  PRIMARY KEY (`Id_Usuario`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;
